	var orgs=G_ORGID; //组织号
	var syts = G_SYTID; //系统号 
	var usrnams=G_USRNAM ; //用户名称
	var typ= &quot;5&quot;;

	var param = new Object();
	param.usrids=usrids;
	param.accids=accids;
	param.orgs=orgs;
	param.syts=syts;
	param.usrnams=usrnams;
	param.typ=typ
	param.yymm1=&quot;&quot;;
	param.yymm2=&quot;&quot;;
	param.xmlstr=xmlstr;
	param.swjg_dm = G_DEPTID;

	var enddat = window.showModalDialog(&quot;show.sp?grdid=TKParam&typ=&quot;+typ,&quot;&quot;,&quot;dialogHeight=300px;dialogWidth=420px;toolbar=no;menubar=no;scrollbars=no;resizable=no;location=no;status=no&quot;);
	if (enddat != &quot;undefined&quot; && enddat != null) {
		//param.enddat = enddat;
		//param.enddat = enddat.substr(0,enddat.indexOf(&quot;,&quot;));
		param.toswjg=&quot;&quot;;
		param.enddat = enddat.substr(0,enddat.indexOf(&quot;,&quot;));
		param.tousr= enddat.substr(enddat.indexOf(&quot;_&quot;)+1);
		var msg = invokeOSFuncExt(&quot;GXHZTAX.DesktopLayout.insertTasks&quot;,param);
		alert(msg);
	}

}

function getXmlStr(sheet,row1,col1,row2,col2)
{
	var xmlstr = &quot;&lt;?xml version=&apos;1.0&apos;?&gt;&lt;ROWSET&gt;&quot;;
	var i = 0;
	for (var r=row1;r&lt;=row2;r++) {
		if (_this.GetCellText(sheet,r,col1) == &quot;1&quot;) {
			xmlstr += &quot;&lt;ROW num=\&quot;&quot;+(++i)+&quot;\&quot;&gt;\n&quot;;
			for (var c=col1;c&lt;=col2;c++) {
				var cname = _this.GetColName(sheet,c);
				var str = _this.GetCellText(sheet,r,c);
				xmlstr += &quot;&lt;&quot;+cname+&quot;&gt;&quot;+str+&quot;&lt;/&quot;+cname+&quot;&gt;\n&quot;
			}
			xmlstr += &quot;&lt;/ROW&gt;\n&quot;;
		}
	}
	xmlstr += &quot;&lt;/ROWSET&gt;&quot;;
	return xmlstr;
}

function getSelectRow()
{
	var comps = &quot;&quot;;
	for (var r=_this.GetMainCellRangeRow1(0);r&lt;=_this.GetMainCellRangeRow2(0);r++) {
		if (_this.GetCellText(0,r,1) == &quot;1&quot;) {
			var id = _this.GetCellText(0,r,3);
			if (comps == &quot;&quot;) comps += id;
			else comps += &quot;,&quot; + id;
		}
	}
	return comps;
}
//非国税管理企业
function isnoGYCompany()
{
	if (!confirm(&quot;是否标志为非工业纳税企业？&quot;)) return;
	var comps = getSelectRow();

	if (comps != &quot;&quot;) {
		var param = new Object();
		param.cms = comps;
		param.thisusrid = G_USRID;
		var ret = invokeOSFuncExt(&quot;updateFlag&quot;,param);
		alert(ret);
	}
}

//国税管理企业
function isGYCompany()
{
	if (!confirm(&quot;是否标志工业纳税企业？&quot;)) return;
	var comps = getSelectRow();

	if (comps != &quot;&quot;) {
		var param = new Object();
		param.cms = comps;
		param.thisusrid = G_USRID;
		var ret = invokeOSFuncExt(&quot;updateFlag2&quot;,param);
		alert(ret);
	}
}

//点击菜单项
function _thisOnMenuItemSelect(sheet,row,col,menuitemid)
{
	if (menuitemid == &quot;isNoGY&quot;) {
		isnoGYCompany();
	}
	else if (menuitemid == &quot;isGY&quot;) {
		isGYCompany();
	}
}

ROW.GRDOSDS_VALUE:
var pub = new JavaPackage(&quot;com.xlsgrid.net.pub&quot;);
var web = new JavaPackage ( &quot;com.xlsgrid.net.web&quot; );

//显示查询参数前预处理
//用于在查询或报表显示查询参数前的预处理。
//可以往sb（StringBuffer）中append HTML内容或额外附近脚本
//可以修改paramDs的内容，决定哪些参数可见或修改默认值
//  ID:编号;  NAME:标题; KEYVAL:关键字; SQLWHE:WHERE条件; DEFVAL:默认值
//  TIP:提示; EDTFLG:是否可修改;  VISFLG:是否可显示; KEYFLG:关键字段(没有作用)
//  DISPORD:参数显示次序号(修改无效); INPCTL:控件类型
function beforeShowParam(request,sb,paramDs,usrinfo)
//var request=javax.servlet.http.HttpServletRequest(); var sb = new java.lang.StringBuffer();var paramDs = new EAXmlDS();var usrinfo = new web.EAUserinfo();
{
	//throw new Exception(paramDs.GetXml());
	var usrinfo = web.EASession.GetLoginInfo(request);
	var usrorg = usrinfo.getusrOrg();
	var usrid = usrinfo.getUsrid();
	var ds = pub.EADbTool.QuerySQL(&quot;select a.*,nvl(b.SCOPE,&apos;NO&apos;) SCOPE from usr a,v_depts b where a.deptid=b.id and a.org=b.org and a.org=&apos;&quot;+usrorg+&quot;&apos; and a.id=&apos;&quot;+usrid+&quot;&apos;&quot;);
	if (ds.getRowCount() &gt; 0) {
		var scope = ds.getStringAt(0,&quot;SCOPE&quot;);
		if (scope != &quot;ALL&quot;) {
			paramDs.setValueAt(4,11,&quot;0&quot;);
		}
	}
}

//替换SQL参数
function replaceParam(mwobj,request,sql)
{
	var taxman = request.getParameter(&quot;TAXMAN&quot;);

	if (taxman != &quot;&quot;) {
		//sql = pub.EAFunc.Replace(sql,&quot;[%TAXMANSTR]&quot;,&quot;and taxman like (select name from v_tax_taxman where id=&apos;&quot;+taxman+&quot;&apos;)&quot;);
		sql = pub.EAFunc.Replace(sql,&quot;[%TAXMANSTR]&quot;,&quot;and taxman like &apos;%&quot;+taxman+&quot;%&apos;&quot;);

	}
	else {
		sql = pub.EAFunc.Replace(sql,&quot;[%TAXMANSTR]&quot;,&quot;&quot;);
	}


	var usrinfo = web.EASession.GetLoginInfo(request);
	var usrorg = usrinfo.getusrOrg();
	var usrid = usrinfo.getUsrid();
	var swjg_dm = request.getParameter(&quot;SWJG_DM&quot;);
	var ds = pub.EADbTool.QuerySQL(&quot;select a.*,nvl(b.SCOPE,&apos;NO&apos;) SCOPE from usr a,v_depts b where a.deptid=b.id and a.org=b.org and a.org=&apos;&quot;+usrorg+&quot;&apos; and a.id=&apos;&quot;+usrid+&quot;&apos;&quot;);
	if (ds.getRowCount() &gt; 0) {
		var scope = ds.getStringAt(0,&quot;SCOPE&quot;);
		if (scope == &quot;ALL&quot;) {
			sql = pub.EAFunc.Replace(sql,&quot;[%SWJGSTR]&quot;,&quot;and b.swjg_dm like &apos;%[%SWJG_DM]%&apos;&quot;);

		}
		else {
			sql = pub.EAFunc.Replace(sql,&quot;[%SWJGSTR]&quot;,&quot;and b.swjg_dm like (select decode(scope,&apos;ALL&apos;,&apos;%&apos;,substr(&apos;[%SYS_DEPTID]&apos;,0,7 )||&apos;%&apos;) from v_depts where id=&apos;[%SYS_DEPTID]&apos;)&quot;);
		}
	}
	sql = pub.EAFunc.Replace(sql,&quot;[%SWJGSTR]&quot;,&quot;and b.swjg_dm like (select decode(scope,&apos;ALL&apos;,&apos;%&apos;,&apos;[%SYS_DEPTID]&apos;) from v_depts where id=&apos;[%SYS_DEPTID]&apos;)&quot;);

	var flg = pub.EAFunc.NVL(request.getParameter(&quot;FLG&quot;),&quot;&quot;);
	if (flg == &quot;1&quot;) {
		sql = pub.EAFunc.Replace(sql,&quot;[%FLGSTR]&quot;,&quot; and a.id not in (select cmid from TAX_NOTAXCOM)&quot;);
	}
	if (flg == &quot;0&quot;) {
		sql = pub.EAFunc.Replace(sql,&quot;[%FLGSTR]&quot;,&quot; and a.id in (select cmid from TAX_NOTAXCOM)&quot;);
	}
	else {
		sql = pub.EAFunc.Replace(sql,&quot;[%FLGSTR]&quot;,&quot;&quot;);
	}

	return sql;
}

function updateFlag()
{
	var db = null;
	var sql = &quot;&quot;;
	var ret = 0;
	try {
		db = new pub.EADatabase();
		var ammnos = cms.split(&quot;,&quot;);
		for (var i=0;i&lt;ammnos.length();i++) {
			sql = &quot;insert into TAX_NOTAXCOM(cmid,crtusr) values(&apos;&quot;+ammnos[i]+&quot;&apos;,&apos;&quot;+thisusrid+&quot;&apos;)&quot;;
			ret += db.ExcecutSQL(sql);
		}

		db.Commit();
		return &quot;操作成功! 标志记录数&quot;+ret;
	}
	catch(e) {
		if (db != null) db.Rollback();
		return &quot;操作失败&quot;+e.toString();
	}
	finally {
		if (db != null) db.Close();
	}
}

